import SideNav from '../components/side-nav.component';

import './styles/app.styles.scss';

export async function getStaticProps(context) {
  const res = await axios.get('https://jsonplaceholder.typicode.com/photos');
  const { data } = res;

  return {
    props: { ...data }, // will be passed to the page component as props
  };
}

const ShadzApp = ({ Component, pageProps }, props) => {

   console.log('WE HOMEEEEEEEE', Object.values(props)[0]);
  
  return (
    <div className='page-container'>
      <div className='page-wrapper'>
        <div className='top-nav'>
          <h1>THE SHADZ LOGO</h1>
          <span className='top-nav__items'>TOP NAV ITEMS</span>
        </div>
        <div className='center-container'>
          <SideNav />
          <Component {...pageProps} />
        </div>
        <footer className='footer'>FOOTER</footer>
      </div>
    </div>
  );
}

export default ShadzApp;
